import "./App.css";
import "./Board.css";
import BoardItem from "./BoardItem";
import { Link } from "react-router-dom";

function Board() {
  return (
    <div className="board">
      <div className="boardOpt">
        <span> number </span> <span> title </span> <span> writer </span> <span> date </span> 
      </div>
      <BoardItem />
      <BoardItem />
      <BoardItem />
      <BoardItem />
      <BoardItem />
      <BoardItem />
      <Link to="/write">
        <div className="wbutton">
          <button>글 작성</button>
        </div>
      </Link>
    </div>
  );
}

export default Board;
